import { Link } from "react-router-dom";

function NotFound () {


    return (
        <div>
            <h1>해당 페이지를 찾을 수 없습니다</h1>
            <h3>주소가 잘못되었거나 제공하지 않는 페이지입니다.</h3>
            <Link to={'/'}>메인페이지로 이동</Link>
        </div>
    );

}

export default {NotFound}
